import React from 'react';
import PropTypes from 'prop-types';

export const Navbar = () => {
  return (
    <div>
      <h1>Navbar </h1>
    </div>
  );
};

Navbar.prototype = {
  title: PropTypes.String.isRequired,
  icons: PropTypes.String.isRequired,
};

Navbar.defaultProps = {
  title: 'Contact Management',
  icons: 'fas fa-id-card-alt',
};
